import{_ as e,o as t,c as a,O as r}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 64.2-739 Application of §§ 64.2-737 and 64.2-738.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/64.2-739.md","filePath":"vacode/64.2-739.md"}'),n={name:"vacode/64.2-739.md"},i=r('<h1 id="§-64-2-739-application-of-§§-64-2-737-and-64-2-738" tabindex="-1">§ 64.2-739 Application of §§ 64.2-737 and 64.2-738. <a class="header-anchor" href="#§-64-2-739-application-of-§§-64-2-737-and-64-2-738" aria-label="Permalink to &quot;§ 64.2-739 Application of §§ 64.2-737 and 64.2-738.&quot;">​</a></h1><p>Sections <a href="http://law.lis.virginia.gov/vacode/64.2-737/" target="_blank" rel="noreferrer">64.2-737</a> and <a href="http://law.lis.virginia.gov/vacode/64.2-738/" target="_blank" rel="noreferrer">64.2-738</a> shall apply to any private foundation, charitable trust, or split-interest trust defined or described therein and established after December 31, 1969; and to any such private foundation, charitable trust, or split-interest trust established before January 1, 1970, only for its taxable years beginning on and after January 1, 1972, unless the exceptions provided in § 508(e)(2)(A) or (B) of the Internal Revenue Code shall apply or unless the trustee or trustees shall elect that this section shall not apply by filing written notice of such election with the Attorney General, and with the clerk of the court in which its governing instrument may be recorded, on or before December 31, 1971.</p><p>2005, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0935" target="_blank" rel="noreferrer">935</a>, § 55-544.21; 2012, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?121+ful+CHAP0614" target="_blank" rel="noreferrer">614</a>.</p>',3),o=[i];function l(s,c,d,p,h,f){return t(),a("div",null,o)}const g=e(n,[["render",l]]);export{u as __pageData,g as default};
